static void handleBrightness(void) {
  char level = Serial.read();

  switch (level) {
    case '1':
      brightness = 1;
      for (int i = 0; i < 8; i++) {
        dummyData[i] = idle8PPM[i];
      }
      break;

    case '2':
      brightness = 2;
      for (int i = 0; i < 8; i++) {
        dummyData[i] = idle4PPM[i];
      }
      break;

    case '3':
      brightness = 3;
      for (int i = 0; i < 8; i++) {
        dummyData[i] = idle2PPM[i];
      }
      break;

    case '4':
      brightness = 4;
      for (int i = 0; i < 8; i++) {
        dummyData[i] = idle43OPPM[i];
      }
      break;

    default:
      for (int i = 0; i < 8; i++) {
        dummyData[i] = 0;
      }
      break;
  }
}

static void errorHandler(void) {
  Serial.println("ERROR!");
  cli();
  sampleCount = 0;
  chipCount = 0;
  sei();
  state = IDLE;
  startTransmission = 0;
  stIdlePromptFlag = 1;
}